import React from 'react';
import Link from 'next/link';
import Router from 'next/router';

import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Card from '@material-ui/core/Card';
import Typography from '@material-ui/core/Typography';
import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';

import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles({
  card: {
    minWidth: 275,
  },
  bullet: {
    display: 'inline-block',
    margin: '0 2px',
    transform: 'scale(0.8)',
  },
  title: {
    fontSize: 14,
  },
  pos: {
    marginBottom: 12,
  },
});


var divStyle = {
  color: 'white'
  //color: 'dodgerblue'
};

var divStyle2 = {
  //color: 'white'
  color: 'dodgerblue'
};

var divStyle3 = {
  color: 'black'
}

/*const theme = createMuiTheme({
  typography: Typography(createPalette(), {
    fontFamily: '"Comic Sans"',
  })
});*/

const classes = useStyles();
const bull = <span className={classes.bullet}>•</span>;

class Home extends React.Component{ 


  render(props) {

  return (<div> 
      <Card style={{position: 'absolute', display: 'inline-block', top: '40%', left: '5%', maxWidth: 150}} align="center">
        <Typography variant="h5" component="h3">
        </Typography>
        <Typography component="p" fontFamily="BlinkMacSystemFont">
          Matching Princeton students with visiting guests.
        </Typography>
      </Card>

      <Card className={classes.card}>
      <CardContent>
        <Typography className={classes.title} color="textSecondary" gutterBottom>
          Word of the Day
        </Typography>
        <Typography variant="h5" component="h2">
          be
          {bull}
          nev
          {bull}o{bull}
          lent
        </Typography>
        <Typography className={classes.pos} color="textSecondary">
          adjective
        </Typography>
        <Typography variant="body2" component="p">
          well meaning and kindly.
          <br />
          {'"a benevolent smile"'}
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>

    <style jsx>{`
      :global(body) {
        margin: 0;
        background: url("/static/princeton-hamilton-hall.jpg");
        background-size: cover;
      }
    `}</style> 
  </div>

  )}
}
export default Home
